part of '../svg_helper.dart';

enum BrandLogos {
  google,
  microsoft,
  adobe,
  walmart,
  paypal,
  swiggy,
  amazon,
  oyo,
  dream11,
  intuit;

  String get svgCode {
    switch (this) {
      case BrandLogos.google:
        return GoogleLogo.getCode();
      case BrandLogos.microsoft:
        return MicrosoftLogo.getCode();
      case BrandLogos.adobe:
        return AdobeLogo.getCode();
      case BrandLogos.walmart:
        return WalmartLogo.getCode();
      case BrandLogos.paypal:
        return PaypalLogo.getCode();
      case BrandLogos.swiggy:
        return SwiggyLogo.getCode();
      case BrandLogos.amazon:
        return AmazonLogo.getCode();
      case BrandLogos.oyo:
        return OyoLogo.getCode();
      case BrandLogos.dream11:
        return Dream11Logo.getCode();
      case BrandLogos.intuit:
        return IntuitLogo.getCode();
    }
  }
}

